function deal_login_js() {

    /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton_11': 'deal_login_mobilebutton_11',
        'spacer_21': 'deal_login_spacer_21',
        'mobileworkarea_18': 'deal_login_mobileworkarea_18',
        'spacer_40': 'deal_login_spacer_40',
        'mobiletextinput_22': 'deal_login_mobiletextinput_22',
        'mobiletextinput_23': 'deal_login_mobiletextinput_23',
        'mobilegrid_33': 'deal_login_mobilegrid_33',
        'mobilegridcell_34': 'deal_login_mobilegridcell_34',
        'mobilebutton_38': 'deal_login_mobilebutton_38',
        'mobilegridcell_35': 'deal_login_mobilegridcell_35',
        'mobilebutton_39': 'deal_login_mobilebutton_39',
        'mobileimage_3': 'deal_login_mobileimage_3',
        'mobilelabel_20': 'deal_login_mobilelabel_20',
        'Crops': 'deal_login_Crops',
        'Insurance': 'deal_login_Insurance',
        'Agrotips': 'deal_login_Agrotips'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    /*
     * Nonvisual components
     */

    Apperyio.mappings = Apperyio.mappings || {};

    Apperyio.datasources = Apperyio.datasources || {};

    Apperyio.CurrentScreen = 'deal_login';
    _.chain(Apperyio.mappings).filter(function(m) {
        return m.homeScreen === Apperyio.CurrentScreen;
    }).each(Apperyio.UIHandler.hideTemplateComponents);

    /*
     * Events and handlers
     */

    // On Load
    var deal_login_onLoad = function() {
            deal_login_elementsExtraJS();

            deal_login_deviceEvents();
            deal_login_windowEvents();
            deal_login_elementsEvents();
        };

    // screen window events


    function deal_login_windowEvents() {

        $('#deal_login').bind('pageshow orientationchange', function() {
            var _page = this;
            adjustContentHeightWithPadding(_page);
        });

    };

    // device events


    function deal_login_deviceEvents() {
        document.addEventListener("deviceready", function() {

        });
    };

    // screen elements extra js


    function deal_login_elementsExtraJS() {
        // screen (deal_login) extra code

    };

    // screen elements handler


    function deal_login_elementsEvents() {
        $(document).on("click", "a :input,a a,a fieldset label", function(event) {
            event.stopPropagation();
        });

        $(document).off("click", '#deal_login_mobileheader [name="mobilebutton_11"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    $('[id="deal_login_panel_2"]').panel("open");

                }
            },
        }, '#deal_login_mobileheader [name="mobilebutton_11"]');

        $(document).off("click", '#deal_login_mobilecontainer [name="mobilebutton_38"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('dealersreg', {
                        transition: 'slideup',
                        reverse: false
                    });

                }
            },
        }, '#deal_login_mobilecontainer [name="mobilebutton_38"]');

        $(document).off("click", '#deal_login_mobilecontainer [name="mobilebutton_39"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('dealers_page', {
                        reverse: false
                    });

                }
            },
        }, '#deal_login_mobilecontainer [name="mobilebutton_39"]');

        $(document).off("click", '#deal_login_panel_2 [name="Crops"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('crops', {
                        transition: 'fade',
                        reverse: false
                    });

                }
            },
        }, '#deal_login_panel_2 [name="Crops"]');
        $(document).off("click", '#deal_login_panel_2 [name="Insurance"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('Insurance', {
                        transition: 'pop',
                        reverse: false
                    });

                }
            },
        }, '#deal_login_panel_2 [name="Insurance"]');
        $(document).off("click", '#deal_login_panel_2 [name="Agrotips"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('Agrotips', {
                        transition: 'fade',
                        reverse: false
                    });

                }
            },
        }, '#deal_login_panel_2 [name="Agrotips"]');

    };

    $(document).off("pagebeforeshow", "#deal_login").on("pagebeforeshow", "#deal_login", function(event, ui) {
        Apperyio.CurrentScreen = "deal_login";
        _.chain(Apperyio.mappings).filter(function(m) {
            return m.homeScreen === Apperyio.CurrentScreen;
        }).each(Apperyio.UIHandler.hideTemplateComponents);
    });

    deal_login_onLoad();
};

$(document).off("pagecreate", "#deal_login").on("pagecreate", "#deal_login", function(event, ui) {
    Apperyio.processSelectMenu($(this));
    deal_login_js();
});